window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"24.1.0","implementation":{"name":"cucumber-jvm","version":"7.19.0"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"23+37-2369"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1728824680,"nanos":905574600}}},{"source":{"uri":"file:\/\/\/C:\/IntelliJ%20IDEA\/Project_CucumberFramework\/src\/test\/resources\/features\/UserStory18.feature","data":"@US18\r\nFeature: User Story 18 - Vendor must be able to create Coupons\r\n\r\n  Scenario: TC001 - User must be able to write Code to create Coupons as a Vendor.\r\n    Given click the Sign out button\r\n    When click on Store Manager\r\n    And click on Coupons\r\n    Then click the Add New button\r\n    And enter a Coupon code in the Code box: \"Welcome20\"\r\n    But wait 1 seconds\r\n    Then verifies that can type a code in the Codebox.\r\n\r\n  Scenario: TC002 - As a Vendor, Description should be written when creating Coupons.\r\n    Given click the Sign out button\r\n    When click on Store Manager\r\n    And click on Coupons\r\n    Then click the Add New button\r\n    And enter a description in the Description box: \"This is a 20% Discount Coupon\"\r\n    But wait 1 seconds\r\n    Then verifies that can type description in the Descriptionbox.\r\n\r\n  Scenario: TC003 - As a Vendor, you should be able to select Discount Type, Percentage discount when creating Coupons.\r\n    Given click the Sign out button\r\n    When click on Store Manager\r\n    And click on Coupons\r\n    Then click the Add New button\r\n    And select Percentage discount in the Discount Type section\r\n    Then verifies that can select Percentage discount.\r\n\r\n  Scenario: TC004 - As a Vendor, you should be able to select Discount Type as Fixed Product Discount when creating Coupons.\r\n    Given click the Sign out button\r\n    When click on Store Manager\r\n    And click on Coupons\r\n    Then click the Add New button\r\n    And select Fixed Product Discount in the Discount Type section\r\n    Then verifies that can select Fixed Product Discount.\r\n\r\n  Scenario: TC005 - Coupon Amount must be written when creating Coupons as Vendor.\r\n    Given click the Sign out button\r\n    When click on Store Manager\r\n    And click on Coupons\r\n    Then click the Add New button\r\n    And enter a discount amount in the Coupon amount box: \"20\"\r\n    But wait 2 seconds\r\n    Then verifies that can entered discount amount in the Coupon Amount box.\r\n\r\n  Scenario: TC006 - When creating Coupons as a Vendor, user cannot enter letters in the Coupon Amount box.\r\n    Given click the Sign out button\r\n    When click on Store Manager\r\n    And click on Coupons\r\n    Then click the Add New button\r\n    And enter a discount amount in the Coupon amount box: \"aBc\"\r\n    Then verifies letters cannot be entered in the Coupon Amount box.\r\n\r\n  Scenario: TC007 - When creating Coupons as a Vendor, special characters cannot be entered in the Coupon Amount box.\r\n    Given click the Sign out button\r\n    When click on Store Manager\r\n    And click on Coupons\r\n    Then click the Add New button\r\n    And enter a discount amount in the Coupon amount box: \"#@\"\r\n    Then verifies special characters cannot be entered in the Coupon Amount box.\r\n\r\n  Scenario: TC008 - When creating Coupons as a Vendor, you should not be able to enter a negative number in the Coupon Amount box.\r\n    Given click the Sign out button\r\n    When click on Store Manager\r\n    And click on Coupons\r\n    Then click the Add New button\r\n    And enter a discount amount in the Coupon amount box: \"-15\"\r\n    Then verifies negative number cannot be entered in the Coupon Amount box.\r\n\r\n  Scenario: TC009 - Coupon expiry date must be entered when creating Coupons as Vendor.\r\n    Given click the Sign out button\r\n    When click on Store Manager\r\n    And click on Coupons\r\n    Then click the Add New button\r\n    And enter a data in the Coupon expiry date section: \"2024-11-30\"\r\n    Then verifies that can be entered in the Coupon expiry date section.\r\n\r\n  Scenario Outline: TC010 - When creating Coupons as a Vendor, special characters\/letters should not be entered in the Coupon expiry date box.\r\n    Given click the Sign out button\r\n    When click on Store Manager\r\n    And click on Coupons\r\n    Then click the Add New button\r\n    And enter a data in the Coupon expiry date section: \"<special characters\/letters>\"\r\n    Then verifies special characters-letters cannot be entered in the Coupon expiry date section\r\n    Examples:\r\n      | special characters\/letters |\r\n      | ####-@@-%%                 |\r\n      | abcD-Ba-dx                 |\r\n\r\n\r\n  Scenario: TC011 - As Vendor, Allow free shipping, Show on store should be selected when creating Coupons.\r\n    Given click the Sign out button\r\n    When click on Store Manager\r\n    And click on Coupons\r\n    Then click the Add New button\r\n    And click on the Allow free shipping checkbox\r\n    Then verifies that the Allow free shipping box is checked\r\n    And click on the Show on store checkbox\r\n    Then verifies that the Show on store box is checked\r\n\r\n  Scenario: TC012 - Must be able to create Coupons as a Vendor (My Account >Store Manager > Coupons > Add New)\r\n    Given click the Sign out button\r\n    When click on Store Manager\r\n    And click on Coupons\r\n    Then click the Add New button\r\n    And enter a Coupon code in the Code box: \"Welcome20\"\r\n    And enter a description in the Description box: \"This is a 20% Discount Coupon\"\r\n    And select Percentage discount in the Discount Type section\r\n    And enter a discount amount in the Coupon amount box: \"20\"\r\n    And enter a data in the Coupon expiry date section: \"2024-11-30\"\r\n    And click on the Allow free shipping checkbox\r\n    And click on the Show on store checkbox\r\n    And click Submit button\r\n    But wait 4 seconds\r\n    Then verifies that can create a Coupon as a Vendor.\r\n\r\n  Scenario: TC013 - When creating Coupons as Vendor, by leaving the fields blank should not be created Coupon.\r\n    Given click the Sign out button\r\n    When click on Store Manager\r\n    And click on Coupons\r\n    Then click the Add New button\r\n    And leave the Code box blank\r\n    And leave the Description box blank\r\n    And do not select a discount type in the Discount Type section\r\n    And leave the Coupon amount box blank\r\n    And leave the Coupon expiry date section blank\r\n    And don't click on the Allow free shipping checkbox\r\n    And don't click on the Show on store checkbox\r\n    And click Submit button\r\n    But wait 2 seconds\r\n    Then verifies that cannot create Coupon by leaving the fields blank.\r\n\r\n\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/IntelliJ%20IDEA\/Project_CucumberFramework\/src\/test\/resources\/features\/UserStory18.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@US18","id":"929d1084-7e0e-45b2-9d2e-99ccc1c4509f"}],"language":"en","keyword":"Feature","name":"User Story 18 - Vendor must be able to create Coupons","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[],"keyword":"Scenario","name":"TC001 - User must be able to write Code to create Coupons as a Vendor.","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"click the Sign out button","id":"2ecaabb6-32d7-47c0-ae70-7bd92f093896"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"click on Store Manager","id":"f49447aa-af3e-4bb2-9d2c-4172e4d67973"},{"location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"click on Coupons","id":"d9ac74a0-94bb-4ddd-bbdc-f5042e56ad80"},{"location":{"line":8,"column":5},"keyword":"Then be able to select a product and add  to the cart.\r\n    Given click the Sign out button\r\n    And click the Orders button\r\n    And click the Go Shop button\r\n    And click on the search box\r\n    And enter a \"book\"\r\n    Then click on the Search  icon\r\n    And goes to the selected product with number : 1\r\n    And wait until the Bag icon  appears\r\n    And click on the bag icon\r\n    But wait 2 seconds\r\n    Then verifies that selected product has been added to the cart.\r\n\r\n  Scenario: TC002 - User as a Vendor can see the products to be purchased by making a Cart - Checkout.\r\n    Given click the Sign out button\r\n    And click the Orders button\r\n    And click the Go Shop button\r\n    And click on the search box\r\n    And enter a \"bag\"\r\n    Then click on the Search  icon\r\n    And goes to the selected product with number : 5\r\n    And wait until the Bag icon  appears\r\n    And click on the bag icon\r\n    Then click on the Cart icon\r\n    But wait 1 seconds\r\n    And click Checkout button in the opened tab\r\n    But wait 2 seconds\r\n    Then verifies added product is visible in the Cart.\r\n\r\n  Scenario: TC003 - User as a Vendor by purchase,the Billing details on the Checkout page should appear automatically\r\n    Given click the Sign out button\r\n    When click the Orders button\r\n    And click the Go Shop button\r\n    And click on the search box\r\n    And enter a \"headphone\"\r\n    Then click on the Search  icon\r\n    And goes to the selected product with number : 1\r\n    And wait until the Bag icon  appears\r\n    And click on the bag icon\r\n    Then click on the Cart icon\r\n    But wait 1 seconds\r\n    And click Checkout button in the opened tab\r\n    But wait 2 seconds\r\n    Then verifies that Billing details come automatically.\r\n\r\n  Scenario: TC004 - The total amount to be paid as a Vendor should be visible.\r\n    Given click the Sign out button\r\n    When click the Orders button\r\n    And click the Go Shop button\r\n    And click on the search box\r\n    And enter a \"macbook\"\r\n    Then click on the Search  icon\r\n    And goes to the selected product with number : 2\r\n    And wait until the Bag icon  appears\r\n    And click on the bag icon\r\n    Then click on the Cart icon\r\n    But wait 1 seconds\r\n    And click Checkout button in the opened tab\r\n    But wait 2 seconds\r\n    Then verifies that the total amount to be paid is visible.\r\n\r\n  Scenario: TC005 - As Vendor - Wire transfer\/EFT option should be selected.\r\n    Given click the Sign out button\r\n    When click the Orders button\r\n    And click the Go Shop button\r\n    And click on the search box\r\n    And enter a \"macbook\"\r\n    Then click on the Search  icon\r\n    And goes to the selected product with number : 2\r\n    And wait until the Bag icon  appears\r\n    And click on the bag icon\r\n    Then click on the Cart icon\r\n    But wait 1 seconds\r\n    And click Checkout button in the opened tab\r\n    But wait 2 seconds\r\n    And click the Wire transfer-EFT radio button\r\n    Then verifies that can select the Wire transfer-EFT options.\r\n\r\n  Scenario: TC006 - As a Vendor - the Pay at the door option should be selected.\r\n    Given click the Sign out button\r\n    When click the Orders button\r\n    And click the Go Shop button\r\n    And click on the search box\r\n    And enter a \"bag\"\r\n    Then click on the Search  icon\r\n    And goes to the selected product with number : 5\r\n    And wait until the Bag icon  appears\r\n    And click on the bag icon\r\n    Then click on the Cart icon\r\n    But wait 1 seconds\r\n    And click Checkout button in the opened tab\r\n    But wait 2 seconds\r\n    And click the Pay at the door radio button\r\n    Then verifies that can select the Pay at the door options.\r\n\r\n  Scenario: TC007 - As Vendor, you should click on Place Order to see that the shopping is completed.\r\n    Given click the Sign out button\r\n    When click the Orders button\r\n    And click the Go Shop button\r\n    And click on the search box\r\n    And enter a \"tablo\"\r\n    Then click on the Search  icon\r\n    And goes to the selected product with number : 3\r\n    And wait until the Bag icon  appears\r\n    And click on the bag icon\r\n    Then click on the Cart icon\r\n    But wait 1 seconds\r\n    And click Checkout button in the opened tab\r\n    But wait 2 seconds\r\n    And click the Pay at the door radio button\r\n    And click the Place Order button\r\n    Then verifies that the purchase is complete.\r\n\r\n  Scenario: TC008 - Details of the purchases made in My Account -Orders should be visible.\r\n    Given click the Sign out button\r\n    When click the Orders button\r\n    And click the Go Shop button\r\n    And click on the search box\r\n    And enter a \"tablo\"\r\n    Then click on the Search  icon\r\n    And goes to the selected product with number : 3\r\n    And wait until the Bag icon  appears\r\n    And click on the bag icon\r\n    Then click on the Cart icon\r\n    But wait 1 seconds\r\n    And click Checkout button in the opened tab\r\n    But wait 2 seconds\r\n    And click the Pay at the door radio button\r\n    And click the Place Order button\r\n    Then wait until the page loaded\r\n    And click the Sign out button\r\n    And click the Orders button\r\n    Then verifies that the details of the purchase made can be seen.\r\n\r\n  Scenario: TC009 - You can shop as Vendor with the created Coupon.\r\n    Given click the Sign out button\r\n    When click the Orders button\r\n    And click the Go Shop button\r\n    And click on the search box\r\n    And enter a \"bag\"\r\n    Then click on the Search  icon\r\n    And goes to the selected product with number : 5\r\n    And wait until the Bag icon  appears\r\n    And click on the bag icon\r\n    Then click on the Cart icon\r\n    But wait 1 seconds\r\n    And click Checkout button in the opened tab\r\n    But wait 2 seconds\r\n    And click the Enter Your Code link\r\n    Then enter a generated Coupon code in the opened box : \"Welcome20\"\r\n    And click the Apply Coupon button\r\n    Then verifies that can shop as a Vendor with the created Coupon.\r\n\r\n\r\n\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/IntelliJ%20IDEA\/Project_CucumberFramework\/src\/test\/resources\/features\/UserStory20.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@US20","id":"3414fe6d-6c6d-4879-beaa-98c17d89912d"}],"language":"en","keyword":"Feature","name":"User Story 20 - Vendor must be able to buy products with the created Coupons.","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[],"keyword":"Scenario","name":"TC001 - User as a Vendor be able to select a product and add  to the cart.","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"click the Sign out button","id":"9c6abfd0-6236-4717-9e8b-6dab5f9a8acb"},{"location":{"line":6,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"click the Orders button","id":"a47c0604-523f-43cb-a067-8d799c9c258e"},{"location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"click the Go Shop button","id":"d53db983-9c59-42bf-b887-979b7b654927"},{"location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"click on the search box","id":"f593b098-b771-48c9-9069-9d2f4bca8ff6"},{"location":{"line":9,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"enter a \"book\"","id":"30114b00-0207-4936-ac8f-f8d07c38dcd6"},{"location":{"line":10,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"click on the Search  icon","id":"d56cc4c6-424b-4088-ad85-ab2099b5fc66"},{"location":{"line":11,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"goes to the selected product with number : 1","id":"fc47ae4a-75db-4b83-a80d-79
